import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Roll, Slide } from "react-reveal";
import Carousel from "react-spring-3d-carousel";
import uuidv4 from "uuid";

const slides = [
  {
    key: uuidv4(),
    content: (
      <img
        src="https://images.pexels.com/photos/775199/pexels-photo-775199.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500"
        alt="1"
      />
    )
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/800/800/?random" alt="2" />
  },
  {
    key: uuidv4(),
    content: <img src="https://picsum.photos/600/800/?random" alt="3" />
  }
];

export class Interests extends Component {
  render() {
    return (
      <div>
        <Container id="interest" className="interests-section">
          <Row>
            <Col>
              <h2>
                <Roll left cascade>
                  INTERESTS
                </Roll>
              </h2>
              <Slide left>
                <hr />
              </Slide>
            </Col>
          </Row>
          <Carousel slides={slides} />
        </Container>
      </div>
    );
  }
}

export default Interests;
